import React, { Component, Fragment } from "react"
import { connect } from "react-redux"

class LeaderBoardUser extends Component {
	render() {
		const { user } = this.props
		return (
			<Fragment>
				<div className="leaderboard-inner">
					<div class="left-side blue section" contenteditable>
						Left Sidebar
					</div>
					<main class="section coral" contenteditable>
						{" "}
						Main Content
					</main>
					<div class="right-side yellow section" contenteditable>
						Right Sidebar
					</div>
				</div>
			</Fragment>
		)
	}
}

function mapStateToProps({ users }, { id }) {
	const user = users[id]
	return {
		user,
	}
}

export default connect(mapStateToProps)(LeaderBoardUser)
